import React,{useEffect, useState} from 'react';
import axios from 'axios';
import Fragment from 'react-dom'


function AuctionHouse(){
    const [data, setData] = useState({ str: '' });
   useEffect(() => {
    const fetchData = async () => {
      const result = await axios(
        'example/get_auction_house',
      );
      setData(result.data);
    };

    fetchData();
  }, []);

    return (
            <Fragment>
                <div>Auction House Module</div>
                <div>data.str</div>
            </Fragment>
    )

};

export default {
    routeProps: {
        path: '/auction_house',
        component: AuctionHouse
    },
    name: 'AuctionHouse',
}
